import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h4>Welcome!</h4>
      </header>
      <lable for="username" class="formtext">Username</lable>
      <input class="username" type="text" placeholder='Enter the username'></input>
      <br></br>
      <lable for="password" class="formtext">Password</lable>
      <input class="formtext" type="password" placeholder='Enter the Password'></input>
    </div>
  );
}

export default App;
